// Import Styled
import styled from 'styled-components';

export const IconDollar = styled.text`
	box-sizing: border-box;
	background: none;
	color: #10C176;
	margin-right: 8px;
	svg{
		font-size: 16px;
		color: #10C176;
	}
	.roundIcon{
		background-color: #CFF3E3;
		vertical-align: top;    
		position: relative;
    	top: 8px;
	}
`;
